<style> 
.card{
    position: relative;
    height: 600px;
    width: 450px;
    background-color: var(--background-color);
    overflow: auto;
    border-radius: 15px;
    border: solid 5px var(--border-color);
    padding: 10px;
    z-index: 2;
    overflow: hidden;

}

.theme-buttons{
    display: flex;
    justify-content: center;
    gap: 175px;
    margin: 5px;
}

button{
    border: none;
    background: none;
    cursor: pointer;
}

img{
    border-radius: 15px;
    z-index: 10;
}
.avatar{
    display: flex;
    justify-content: center;
}

.info-text{
    display: flex;
    flex-direction: column;
    text-align: center;
    color: var(--text-color);
}

h1{
    position: relative;
    font-size: 2.2rem;
}

p{
    position: relative;
    margin-top: 10px;
}

.sat{
    position: absolute;
    top: 15%;
    height: 300px;
    width: 300px;
    animation: orbit 8s infinite ease-in-out;
}

.planet-1{
    position: absolute;
    top: 20%;
    height: 300px;
    width: 300px;
    animation: planet-1 7s infinite ease-in-out;
}

.social-buttons{
    align-items: center;
    justify-content: space-evenly;
    display: flex;
    margin-top: 1.5em;
}

@keyframes orbit{
    0%{
        left: 0%;
        z-index:1;
        transform:translate(-100%, -20%) scale(0.7);
    }
    25%{
        transform:translate(-100%, -20%) scale(0.3);
        z-index: -1;
    }
    50%{
        left: 100%;
        top: 50%;
    }
    50.001%{
        z-index: 11;
    }
    75%{
        z-index: 11;
        transform: scale(.9);
    }

    100%{
        left:0%;
        z-index: 11;
        transform:translate(-100%, -20%) scale(0.7);
    }
}

@keyframes planet-1{
    0%{
        left: 0%;
        z-index:2;
        transform: translate(-100%, -20%) scale(0.7);
    }
    25%{
        transform:translate(-60%, -20%) scale(0.3);
        z-index: -1;
    }
    50%{
        left: 100%;
    }
    50.001%{
        z-index: 11;
    }
    75%{
        transform: scale(.9);
        z-index: 11;
    }

    100%{
        left:0%;
        z-index: 11;
        transform:translate(-100%, -20%) scale(0.72);
    }
}

@media(hover: hover) and (pointer: fine) {
    .social-buttons svg:hover {
        transform: scale(1.1);
        transition: .25s;
    }
    button:hover{
    transform: scale(1.05);
    transition: .25s;
}
}
</style>

